import React from 'react';
import SiteNav from '../components/SiteNav';
import SiteFooter from '../components/SiteFooter';

import '../css/main.css';

const FAQ = () => {
    return (
      <div className="page-faq">
        <header className="site-header">
          <div className="site-logo">Springfield car reservation</div>
          <div className="row column medium-8 large-6 xlarge-5 xxlarge-4">
            <h1 className="title">Frequently Asked Questions</h1>
          </div>
          <SiteNav/>
        </header>

        <section className="faq-list">
          <div className="row column medium-10 large-8 xxlarge-6">
            <p className="content under_construction">
              Page under construction
            </p>
          </div>
        </section>
      <SiteFooter/>
      </div>
    );
};

export default FAQ;
